syntax = "proto3";

option optimize_for = LITE_RUNTIME;

package com.paulmandal.atak.forwarder.protobufs;

option java_outer_classname = "ProtobufMist";

message Mist {
  string symptoms = 1;
  string treatment = 2;
  string injury = 3;
  string mechanismOfInjury = 4;
  string zapNumber = 5;
  string title = 6;
}
